    public void setmsg()
    {
         Vector<Transaction> t=GlobalAtm.acc.getDetails();
         
         details.setText("Account Number : "+GlobalAtm.acc.getAccountId()+"\n"+"Account Balance : "+GlobalAtm.acc.getBalance()+"\n" );
         details.append("\nType                         Date                 \t            Amount\n\n");
         for(int i=t.size()-1;i>0;i--)
         {
             details.append(t.elementAt(i).getTransactionType()+"       "+t.elementAt(i).getTransactionDate()+"        "+t.elementAt(i).getAmount()+"\n");
         
         }
    
    }
